CREATE TABLE CITY (
CITY_CODE   INTEGER,
CITY_NAME   NVARCHAR(15) NOT NULL,
PRIMARY KEY (CITY_CODE)
);

CREATE TABLE AREA (
AREA_NUM	VARCHAR(5),
AREA_CODE   INTEGER,
AREA_NAME   NVARCHAR(15) NOT NULL,
CITY_CODE   INTEGER,
PRIMARY KEY (AREA_NUM),
FOREIGN KEY(CITY_CODE) REFERENCES CITY ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE PERSON (
N_ID          VARCHAR(10),
P_NAME          NVARCHAR(10) NOT NULL,
P_AGE          INTEGER  NOT NULL,
P_GENDER      NVARCHAR(2) NOT NULL,
P_ADDRESS   NVARCHAR(35) NOT NULL,
P_PHONE      VARCHAR(15) NOT NULL,
P_BIRTH      DATE NOT NULL,
P_is_SCREENER  NVARCHAR(1) NOT NULL,
P_is_CONFIRMED  NVARCHAR(1) NOT NULL,
AREA_NUM   VARCHAR(5),
PRIMARY KEY(N_ID), 
FOREIGN KEY(AREA_NUM) REFERENCES AREA ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE PLACE (
PLACE_ID   INTEGER,
PLACE_NAME   NVARCHAR(35) NOT NULL,		
PLACE_ADDRESS  NVARCHAR(35) NOT NULL,
AREA_NUM   VARCHAR(5),
PRIMARY KEY (PLACE_ID),
FOREIGN KEY(AREA_NUM) REFERENCES AREA ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE FOOTPRINT (
F_NUM		  VARCHAR(10),
N_ID          VARCHAR(10),
PLACE_ID   INTEGER NOT NULL,
F_DATE       DATE NOT NULL,
F_TIME          VARCHAR(15) NOT NULL,
PRIMARY KEY (F_NUM,N_ID),
FOREIGN KEY(N_ID) REFERENCES PERSON ON UPDATE CASCADE ON DELETE CASCADE,
);
ALTER TABLE FOOTPRINT ADD FOREIGN KEY(PLACE_ID)REFERENCES PLACE;


CREATE TABLE SCREEN_STATION (
S_ST_ID   NVARCHAR(15),
S_ST_NAME   NVARCHAR(15) NOT NULL,
S_ST_ADDRESS  NVARCHAR(35) NOT NULL,
S_ST_PHONE      VARCHAR(15) NOT NULL,
S_ST_QUANTITY   INTEGER NOT NULL,
AREA_NUM   VARCHAR(5),
PRIMARY KEY (S_ST_ID),
FOREIGN KEY(AREA_NUM) REFERENCES AREA ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE MEDICAL_INSTITUTION(
MED_ID        NVARCHAR(15),
MED_NAME      NVARCHAR(35) NOT NULL,
MED_ADDRESS   NVARCHAR(35) NOT NULL,
MED_PHONE     VARCHAR(15) NOT NULL,
MED_TYPE      NVARCHAR(15) NOT NULL,
AREA_NUM   VARCHAR(5),
PRIMARY KEY (MED_ID),
FOREIGN KEY(AREA_NUM) REFERENCES AREA ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE HEALTH_CENTER(
MED_ID        NVARCHAR(15),
MED_SERVE_TIME    NVARCHAR(100) NOT NULL,
MED_RESERVE_URL   VARCHAR(100) NOT NULL,
PRIMARY KEY (MED_ID),
FOREIGN KEY(MED_ID) REFERENCES MEDICAL_INSTITUTION ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE HOSPITAL(
MED_ID        NVARCHAR(15),
HOS_LEVEL   NVARCHAR(10) DEFAULT '無',
HOS_TYPE    NVARCHAR(10) DEFAULT '無',
HOS_has_SCREEN  NVARCHAR(10)  NOT NULL,
HOS_has_TREAT  NVARCHAR(10)  NOT NULL,
PRIMARY KEY (MED_ID),
FOREIGN KEY(MED_ID) REFERENCES MEDICAL_INSTITUTION ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE SCREEN_HOSPITAL(
MED_ID        NVARCHAR(15),
S_H_QUANTITY      INTEGER NOT NULL,
PRIMARY KEY (MED_ID),
FOREIGN KEY(MED_ID) REFERENCES MEDICAL_INSTITUTION ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE TREAT_HOSPITAL(
MED_ID        NVARCHAR(15),
HOS_TOTAL_WARD    INTEGER  NOT NULL,
HOS_EMPTY_WARD    INTEGER  NOT NULL,
PRIMARY KEY (MED_ID),
FOREIGN KEY(MED_ID) REFERENCES MEDICAL_INSTITUTION ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE MANUFACTURER(
MANU_CODE    INTEGER,
MANU_NAME  NVARCHAR(35) NOT NULL,
MANU_NATION  NVARCHAR(10) NOT NULL,
PRIMARY KEY(MANU_CODE)
);

CREATE TABLE VACCINE(
VAC_LOT_NUM  VARCHAR(10),
VAC_NAME  NVARCHAR(10) NOT NULL,
VAC_QUANTITY    INTEGER NOT NULL,
VAC_EFFECTIVE_DATE DATE NOT NULL,
VAC_INGREDIENT NVARCHAR(35) NOT NULL,
MANU_CODE       INTEGER,
PRIMARY KEY(VAC_LOT_NUM),
FOREIGN KEY(MANU_CODE) REFERENCES MANUFACTURER ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE DISTRIBUTE(
MED_ID        NVARCHAR(15),
VAC_LOT_NUM   VARCHAR(10),
DIS_QUANTITY  INTEGER NOT NULL,
DIS_DATE   DATE NOT NULL,
PRIMARY KEY(MED_ID,VAC_LOT_NUM),
FOREIGN KEY (MED_ID) REFERENCES MEDICAL_INSTITUTION ON UPDATE CASCADE ON DELETE CASCADE,
FOREIGN KEY (VAC_LOT_NUM) REFERENCES VACCINE ON UPDATE CASCADE ON DELETE CASCADE,
);

CREATE TABLE SCREENER (
N_ID          VARCHAR(10),
SCR_DATE   DATE NOT NULL,
SCR_RESULT   NVARCHAR(2) NOT NULL,
SCR_PCR_RESULT  NVARCHAR(2) NOT NULL,
SCR_CHRONIC     NVARCHAR(35) NOT NULL,
SCR_TRAVEL  NVARCHAR(35) NOT NULL,
S_ST_ID   NVARCHAR(15),
MED_ID        NVARCHAR(15),
PRIMARY KEY (N_ID),
FOREIGN KEY(N_ID) REFERENCES PERSON ON UPDATE CASCADE ON DELETE CASCADE,
);

ALTER TABLE SCREENER ADD FOREIGN KEY(S_ST_ID)REFERENCES SCREEN_STATION;
ALTER TABLE SCREENER ADD FOREIGN KEY(MED_ID)REFERENCES MEDICAL_INSTITUTION;

CREATE TABLE TREATMENT_PLACE(
T_P_ID       NVARCHAR(15),
T_P_NAME      NVARCHAR(20) NOT NULL,
T_P_ADDRESS   NVARCHAR(35) NOT NULL,
T_P_PHONE   VARCHAR(15) NOT NULL,
T_P_COMPILE_DATE  DATE,
T_P_TYPE      NVARCHAR(10) NOT NULL,
AREA_NUM   VARCHAR(5),
PRIMARY KEY(T_P_ID), 
FOREIGN KEY(AREA_NUM) REFERENCES AREA ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE CONFIRMED (
N_ID             VARCHAR(10),
CASE_NUM      INTEGER NOT NULL,
CON_DATE      DATE NOT NULL,
CON_ISOLATE_DATE   DATE NOT NULL,
CON_SYMPTOM_DATE   NVARCHAR(35) DEFAULT '無',
CON_DEATH_DATE     NVARCHAR(35) DEFAULT '無',
CON_SYMPTOM        NVARCHAR(35) DEFAULT '無',
CON_STATUS         NVARCHAR(35) NOT NULL,
T_P_ID       NVARCHAR(15),
MED_ID        NVARCHAR(15),
PRIMARY KEY (N_ID),
FOREIGN KEY(N_ID) REFERENCES PERSON ON UPDATE CASCADE ON DELETE CASCADE,
);

ALTER TABLE CONFIRMED ADD FOREIGN KEY(T_P_ID)REFERENCES TREATMENT_PLACE;
ALTER TABLE CONFIRMED ADD FOREIGN KEY(MED_ID)REFERENCES MEDICAL_INSTITUTION;

CREATE TABLE EP_HOTEL(
T_P_ID       NVARCHAR(15),
HOTEL_PRICE    VARCHAR(35) NOT NULL,
HOTEL_TOTAL_RM FLOAT NOT NULL,
HOTEL_EMPTY_RM FLOAT NOT NULL,
PRIMARY KEY(T_P_ID), 
FOREIGN KEY(T_P_ID) REFERENCES TREATMENT_PLACE ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE CENTRALIZED_QUARANTINE(
T_P_ID       NVARCHAR(15),
CQ_TOTAL_RM    INTEGER NOT NULL,
CQ_EMPTY_RM    INTEGER NOT NULL,
PRIMARY KEY(T_P_ID), 
FOREIGN KEY(T_P_ID) REFERENCES TREATMENT_PLACE ON UPDATE CASCADE ON DELETE CASCADE
);











































